<template><video ref="videoPlayer" controls></video></template>
<script setup>
import { ref, onMounted } from "vue";

const videoPlayer = ref(null);
const base64Images = [
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
];

onMounted(() => {
  const canvas = document.createElement("canvas");
  const ctx = canvas.getContext("2d");
  const videoChunks = [];

  if (!ctx) {
    console.error("Canvas context is not supported.");
  }

  canvas.width = 640; // Adjust canvas dimensions as needed
  canvas.height = 480;

  const mediaRecorder = new MediaRecorder(canvas.captureStream(), {
    mimeType: "video/webm",
  });

  mediaRecorder.ondataavailable = (event) => {
    if (event.data.size > 0) {
      videoChunks.push(event.data);
    }
  };

  mediaRecorder.onstop = () => {
    const blob = new Blob(videoChunks, { type: "video/webm" });
    const url = URL.createObjectURL(blob);

    if (videoPlayer.value) {
      videoPlayer.value.src = url;
    }
  };

  mediaRecorder.start();

  let currentIndex = 0;
  const renderNextFrame = () => {
    if (currentIndex < base64Images.length) {
      const image = new Image();
      image.onload = () => {
        ctx.drawImage(image, 0, 0, canvas.width, canvas.height);
        currentIndex++;
        setTimeout(renderNextFrame, 500); // Delay between frames
      };
      image.src = base64Images[currentIndex];
    } else {
      setTimeout(() => {
        mediaRecorder.stop();
      }, 1000); // Wait for final frame to render before stopping
    }
  };

  renderNextFrame();
});
</script>
